import React, { useEffect, useState } from 'react';
import axios from 'axios';
import {Table} from './features/table/Table';
import './App.css';

function App() {
  const [sensors, setSensores] = useState(null);

  const fetchData = async ()=>{
    try{
      const response = await fetch.get('http://localhost:5000/listings');
      const json = await response.json();
      setSensores(json);
    }catch(e){
      console.log(e.stack);
    }
  }

  useEffect( ()=>{
    fetchData()
    }
  );

  const data = React.useMemo(
    () => [
      {
        col1: 'Hello',
        col2: 'World',
      },
      {
        col1: 'react-table',
        col2: 'rocks',
      },
      {
        col1: 'whatever',
        col2: 'you want',
      },
    ],
    []
  )

  const columns = React.useMemo(
    () => [
      {
        Header: 'Column 1',
        accessor: 'col1',
      },
      {
        Header: 'Column 2',
        accessor: 'col2',
      }
    ],
    []
  )

  return (
    <div className="App">
      <header className="App-header">
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        {/* <Counter /> */}
        <Table columns={columns} data={data}/>
        <div data = {sensors}></div>

      </header>
    </div>
  );
}

export default App;
